import React from "react";
import {  FaInstagram, FaTwitter, FaLeaf } from "";
export default function Footer() {
  return (
    <footer className="custom-footer fixed-footer">
      <div className="footer-content">
        {/* About Section */}
        <div className="footer-section about">
          <h3><FaLeaf className="inline text-green-600" /> Nature’s Cure</h3>
          <p>
            Embrace the healing power of nature with our 100% natural remedies 
            and beauty tips. Nature’s Cure is dedicated to helping you live 
            healthier — the natural way.
          </p>
        </div>

        {/* Quick Links */}
        <div className="footer-section links">
          <h4>Quick Links</h4>
          <ul>
            <li><a href="/about">About Us</a></li>
            <li><a href="/remedies">Natural Remedies</a></li>
            <li><a href="/contact">Contact</a></li>
            <li><a href="/privacy">Privacy Policy</a></li>
          </ul>
        </div>

        {/* Contact Info */}
        <div className="footer-section contact">
          <h4>Contact Us</h4>
          <p>Email: <a href="mailto:info@naturescure.com">info@naturescure.com</a></p>
          <p>Phone: +91 98765 43210</p>
          <p>Visakhapatnam, India</p>
        </div>

        {/* Social Media */}
        <div className="footer-section social">
          <h4>Follow Us</h4>
          <div className="social-icons">
            <a href="https://facebook.com"><FaFacebookF /></a>
            <a href="https://instagram.com"><FaInstagram /></a>
            <a href="https://twitter.com"><FaTwitter /></a>
          </div>
        </div>
      </div>

      {/* Footer Bottom */}
      <div className="footer-bottom">
        <p>© {new Date().getFullYear()} Nature’s Cure. All Rights Reserved.</p>
      </div>
    </footer>
  );
}
